// Navbar.jsx
import React from 'react';

const NavbarB = () => {
  return (
    <nav className="p-4 ">
      <button className="border text-black px-4 py-2 mr-2 hover:bg-gray-200">Streaming</button>
      <button className="border text-black px-4 py-2 mr-2 hover:bg-gray-200 ">Genre</button>
      <button className="border text-black px-4 py-2 ">Batch</button>
    </nav>
  );
};

export default NavbarB;
